    false,nt"url": null,nt"notes": "The Arkansas Education Service Cooperatives
    represent geographic areas of the state that are designed to provide leadership,
    administrative, technical support, resource sharing, purchasing certain services
    and supplies, and professional development for teachers and school districts within
    the cooperative area. Each cooperative contains a number of member school districts.
    The individual school districts are nested within each cooperative area. The outer
    boundary of the Education Service Cooperative are coincident with the School District
    boundaries. There are 15 education service cooperatives throughout Arkansas.",nt"license_title":
